import Navigation from './components/Navigation/Navigation';
import ContactHeader from './components/ContactHeader/ContactHeader';
import Form from './components/Form/Form';

function App() {
  return (
    <div className="App">
        <Navigation/>
        <main className='main_container'>
        <ContactHeader/>
        <Form/>

        </main>

    </div>
  );
}

export default App;
